import React from 'react';
import { Provider } from 'react-redux';

import reduxStore from './state';

const App = () => {
  // HOCs and Providers
  return (
    <div id='app-outer-boundary'>
      <Provider store={reduxStore}>
        App content
      </Provider>
    </div>
  );
}

export default App;
